class App extends Component {
    render() {
        return (
            <Router>
                <Switch>
                    <Route path="/" exact component={Admin} />
                    {/*<Redirect from="/" to="/orders/" />*/}
                </Switch>git
            </Router>
        )
    }
}
export default App
